INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (44, "A", 0, 16, 8, 2, "人助け、応援", "トゥインクルウィッシュ", "東山奈央", 155, "獣人族", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 100101, 27, "ヒヨリ", "人助けが大好き！　前向き格闘娘");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (47, "O", 0, 17, 4, 2, "料理、人間観察", "トゥインクルウィッシュ", "種田梨沙", 158, "ヒューマン", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 100201, 5, "ユイ", "戦闘のサポートが得意な、心優しい少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (46, "B", 0, 18, 1, 2, "読書、乗馬、お茶", "トゥインクルウィッシュ", "早見沙織", 163, "魔族", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 100301, 12, "レイ", "クールで何事にも真っ直ぐな剣士");
