INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, "O", 0, 12, 11, 8, "ヒーローごっこ", "王宮騎士団（NIGHTMARE）", "下田麻美", 146, "獣人族", "？？？", 100501, 25, "マツリ", "ヒーローに憧れる騎士見習いの少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (42, "O", 0, 13, 11, 7, "サックス", "悪魔偽王国軍（ディアボロス）", "浅倉杏美", 150, "魔族", "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 100601, 22, "アカリ", "甘え上手なみんなの人気者");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (32, "B", 0, 14, 1, 7, "プリンを食べること", "悪魔偽王国軍（ディアボロス）", "雨宮天", 130, "魔族", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 100701, 23, "ミヤコ", "プリン大好きゴースト娘");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, "AB", 0, 14, 10, 15, "鏡で自分を見ること", "ヴァイスフリューゲル　ランドソル支部", "大空直美", 150, "エルフ", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 100801, 10, "ユキ", "ボクは誰よりも美しい");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (45, "A", 0, 17, 7, 13, "小説執筆", "トワイライトキャラバン", "髙野麻美", 159, "魔族", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 100901, 5, "アンナ", "前世を信じる中二病患者、「疾風の冥姫」");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (42, "O", 0, 16, 9, 10, "空想、ぬいぐるみ集め", "自警団（カォン）", "内田真礼", 155, "獣人族", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 101001, 22, "マホ", "マホマホ王国のプリンセス");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (44, "A", 0, 15, 8, 3, "お裁縫", "ラビリンス", "阿澄佳奈", 156, "ヒューマン", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 101101, 25, "リノ", "人懐っこくてマシンガントークな妹系少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (46, "A", 0, 17, 12, 6, "妹と遊ぶこと、二度寝、昼寝、早寝", "フォレスティエ", "大橋彩香", 156, "エルフ", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 101201, 24, "ハツネ", "みんなのために超能力を使う眠り姫");
