INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (48, "O", 0, 18, 4, 14, "ファッション", "ルーセント学院", "上坂すみれ", 167, "魔族", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 101601, 10, "スズナ", "天真爛漫で人気者のカリスマモデル");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (53, "A", 0, 19, 7, 10, "踊り、空手", "自警団（カォン）", "高森奈津美", 158, "獣人族", "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 101701, 7, "カオリ", "いつでも「なんくるないさ～」な天然娘");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (52, "B", 0, 23, 8, 14, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", "ルーセント学院", "伊藤静", 162, "魔族", "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 101801, 14, "イオ", "多くの男性を魅了する無垢な女教師");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (21, "O", 0, 10, 4, 5, "かわいいもの集め", "リトルリリカル", "日高里菜", 117, "獣人族", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 102001, 3, "ミミ", "お歌もにんじんも、ウサギさんも大好き♪");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, "B", 0, 12, 6, 9, "観劇、おままごと", "サレンディア救護院", "植田佳奈", 150, "ヒューマン", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 102101, 9, "クルミ", "泣き虫で臆病な守ってあげたい女の子");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, "O", 0, 13, 11, 7, "ゲーム全般", "悪魔偽王国軍（ディアボロス）", "原紗友里", 150, "魔族", "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 102201, 22, "ヨリ", "人見知りであまのじゃくな女の子");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (38, "B", 0, 14, 5, 9, "屋内でできる遊び", "サレンディア救護院", "芹澤優", 148, "ヒューマン", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 102301, 10, "アヤネ", "ぷうきちといつも一緒！");
