INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (43, "B", 0, 16, 7, 13, "実験、裁縫、料理", "トワイライトキャラバン", "橋本ちなみ", 154, "魔族", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 102701, 30, "エリコ", "運命の相手に一途すぎる乙女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (43, "A", 0, 17, 10, 9, "経営、お茶会", "サレンディア救護院", "堀江由衣", 156, "エルフ", "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 102801, 4, "サレン", "救護院を経営する優しい庶民派お嬢様");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, "B", 0, 17, 1, 4, "舞台鑑賞、ダンス", "カルミナ", "日笠陽子", 157, "ヒューマン", "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 102901, 24, "ノゾミ", "歌って踊れる大人気アイドル");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (51, "O", 0, 16, 8, 15, "忍法開発", "ヴァイスフリューゲル　ランドソル支部", "佐藤聡美", 163, "ヒューマン", "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 103001, 31, "ニノン", "トーゴクの神秘、オシエテクダサイ！");
