INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (45, "AB", 0, 18, 3, 12, "慈善事業", "メルクリウス財団", "松嵜麗", 157, "ヒューマン", "この私とともにいる限り、\nお金に不自由はさせませんわ！", 103201, 12, "アキノ", "一人前の商人を目指すパワフルお嬢様");
