INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (55, "A", 0, 22, 3, 12, "ウインドーショッピング", "メルクリウス財団", "今井麻美", 164, "エルフ", "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 103401, 16, "ユカリ", "純情でほっとけない大人の女性");
