INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (43, "A", 0, 13, 8, 8, "剣術、年長者をからかう", "王宮騎士団（NIGHTMARE）", "茅原実里", 149, "ヒューマン", "test", 103701, 11, "トモ", "義理堅くてからかい好きな剣術少女");
