INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (46, "O", 0, 17, 6, 4, "各種楽器", "カルミナ", "福原綾香", 163, "ヒューマン", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 104201, 3, "チカ", "人々を守るために歌う、唱喚士の少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (54, "O", 0, 17, 8, 10, "お菓子作り", "自警団（カォン）", "小松未可子", 168, "獣人族", "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 104301, 9, "マコト", "男勝りで情に厚いワイルド娘");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (50, "A", 0, "??", 5, 7, "世界征服", "悪魔偽王国軍（ディアボロス）", "丹下桜", 172, "魔族", "test", 104401, 5, "イリヤ", "かつては夜を支配した最強の吸血鬼");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (49, "AB", 0, 18, 11, 15, "小説を読むこと", "ヴァイスフリューゲル　ランドソル支部", "長妻樹里", 157, "ヒューマン", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 104501, 19, "クウカ", "妄想大好き！　ほんとは照れ屋な女の子");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (48, "AB", 0, 18, 3, 12, "猫とたわむれること", "メルクリウス財団", "沼倉愛美", 158, "獣人族", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 104601, 1, "タマキ", "弱きを助け強きをくじく猫娘");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (50, "A", 0, 25, 10, 8, "格闘技、湯浴み", "王宮騎士団（NIGHTMARE）", "川澄綾子", 171, "ヒューマン", "？？？", 104701, 25, "ジュン", "素顔を見せない冷静沈着な女性騎士");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (49, "O", 0, 20, 11, 12, "傭兵などのアルバイト", "メルクリウス財団", "田所あずさ", 163, "ヒューマン", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 104801, 11, "ミフユ", "仕事も私事も効率優先な傭兵少女");
