INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (22, "A", 0, 11, 1, 14, "ファッション誌鑑賞、コスメ集め", "ルーセント学院", "久野美咲", 120, "魔族", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 105001, 3, "ミサキ", "ちょっとおませな恋に恋する女の子");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (53, "A", 0, 27, 3, 13, "研究、実験", "トワイライトキャラバン", "三石琴乃", 166, "ヒューマン", "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 105101, 7, "ミツキ", "実験が趣味の危険な科学者");
