INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (49, "O", 0, 20, 11, 12, "傭兵などのアルバイト", "メルクリウス財団", "田所あずさ", 163, "ヒューマン", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 108001, 11, "ミフユ（サマー）", "仕事も私事も効率優先な傭兵少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (42, "AB", 0, 18, 12, 7, "占い", "悪魔偽王国軍（ディアボロス）", "大坪由佳", 157, "魔族", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 108101, 22, "シノブ（ハロウィン）", "占いが得意な霊能少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (32, "B", 0, 14, 1, 7, "プリンを食べること", "悪魔偽王国軍（ディアボロス）", "雨宮天", 130, "魔族", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 108201, 23, "ミヤコ（ハロウィン）", "プリン大好きゴースト娘");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (22, "A", 0, 11, 1, 14, "ファッション誌鑑賞、コスメ集め", "ルーセント学院", "久野美咲", 120, "魔族", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 108301, 3, "ミサキ（ハロウィン）", "ちょっとおませな恋に恋する女の子");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (46, "O", 0, 17, 6, 4, "各種楽器", "カルミナ", "福原綾香", 163, "ヒューマン", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 108401, 3, "チカ（クリスマス）", "人々を守るために歌う、唱喚士の少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, "B", 0, 12, 6, 9, "観劇、おままごと", "サレンディア救護院", "植田佳奈", 150, "ヒューマン", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 108501, 9, "クルミ（クリスマス）", "泣き虫で臆病な守ってあげたい女の子");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (38, "B", 0, 14, 5, 9, "屋内でできる遊び", "サレンディア救護院", "芹澤優", 148, "ヒューマン", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 108601, 10, "アヤネ（クリスマス）", "ぷうきちといつも一緒！");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (44, "A", 0, 16, 8, 2, "人助け、応援", "トゥインクルウィッシュ", "東山奈央", 155, "獣人族", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 108701, 27, "ヒヨリ（ニューイヤー）", "人助けが大好き！　前向き格闘娘");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (47, "O", 0, 17, 4, 2, "料理、人間観察", "トゥインクルウィッシュ", "種田梨沙", 158, "ヒューマン", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 108801, 5, "ユイ（ニューイヤー）", "戦闘のサポートが得意な、心優しい少女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (46, "B", 0, 18, 1, 2, "読書、乗馬、お茶", "トゥインクルウィッシュ", "早見沙織", 163, "魔族", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 108901, 12, "レイ（ニューイヤー）", "クールで何事にも真っ直ぐな剣士");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (43, "B", 0, 16, 7, 13, "実験、裁縫、料理", "トワイライトキャラバン", "橋本ちなみ", 154, "魔族", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 109001, 30, "エリコ（バレンタイン）", "運命の相手に一途すぎる乙女");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (54, "O", 0, 18, 10, 3, "家事全般", "ラビリンス", "生天目仁美", 168, "ヒューマン", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 109101, 24, "シズル（バレンタイン）", "お姉ちゃんがお世話してあげるからねっ！");
