INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (45, "O", 0, 15, 2, "", "食べること、眠ること", "？？？", "こやまきみこ", 144, "ヒューマン", "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", 109301, 4, "ルゥ", "マナリア魔法学院の新入生");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (67, "B", 0, 17, 11, "", "ピアノ", "？？？", "福原綾香", 167, "半人半竜", "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", 109401, 3, "グレア", "人を超越した力を有す心優しい竜姫");
